import React from 'react';

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="sections">
        <span>Music</span>
        <span>Podcast</span>
        <span>Live</span>
        <span>Radio</span>
      </div>
      <input
        type="text"
        placeholder="Michael Jackson"
        className="search-bar"
      />
    </div>
  );
};

export default Navbar;
